{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/newweek/google-data-analytics-capstone-bike-sharing?scriptVersionId=132855031\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"44b658e7","metadata":{"papermill":{"duration":0.010204,"end_time":"2023-06-08T19:51:02.880733","exception":false,"start_time":"2023-06-08T19:51:02.870529","status":"completed"},"tags":[]},"source":["# Context \n","\n","After six months of studying the fundamentals of data analytics, this notebook serves as the practical case study for the culmination of the [Google Data Analytics](http://https://www.coursera.org/google-certificates/data-analytics-certificate) Certification program. The case study revolves around CYCLISTIC, a fictional bike-sharing business entity. In order to analyze and draw insights, a public bike-sharing dataset provided by Motivate International Inc. under  [this licensing   Agreement](http://https://ride.divvybikes.com/data-license-agreement). For more detailed information and specific instructions, please refer to the Coursera Google Data Analytics Certification Capstone page. If you have any questions or need assistance with your analysis, feel free to ask for guidance\n"]},{"cell_type":"markdown","id":"70268ae6","metadata":{"papermill":{"duration":0.010105,"end_time":"2023-06-08T19:51:02.899796","exception":false,"start_time":"2023-06-08T19:51:02.889691","status":"completed"},"tags":[]},"source":["## The mission statement\n","The objective of the bike-sharing company is to conduct an analysis of their user data in order to identify the primary distinctions in behavior between their two user categories: the \"casual\" riders who pay per ride and the annual members who subscribe to the service on a yearly basis.\n"]},{"cell_type":"markdown","id":"1f8aac99","metadata":{"papermill":{"duration":0.00849,"end_time":"2023-06-08T19:51:02.916834","exception":false,"start_time":"2023-06-08T19:51:02.908344","status":"completed"},"tags":[]},"source":["## About  CYCLISTIC \n","\n","Cyclistic's bike-sharing program in Chicago has grown since its launch in 2016, now offering 5,824 bicycles across 692 stations. The company aims to analyze user data to distinguish behavioral differences between their two user types: \"casual\" riders who pay per ride and annual members who subscribe. With the goal of maximizing annual memberships for future growth, Cyclistic plans to convert casual riders into members. By understanding the disparities between the two user groups, the marketing team seeks to develop effective strategies and explore the impact of digital media. Historical bike trip data analysis will provide valuable insights for their marketing tactics."]},{"cell_type":"markdown","id":"888a7bd9","metadata":{"papermill":{"duration":0.00848,"end_time":"2023-06-08T19:51:02.933879","exception":false,"start_time":"2023-06-08T19:51:02.925399","status":"completed"},"tags":[]},"source":["## stakeholders\n","* **Lily Moreno**: The director of marketing and your manager. Moreno is responsible for the development of campaignsand initiatives to promote the bike-share program. These may include email, social media, and other channels.\n","* **Cyclistic marketing analytics team**: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy learning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic achieve them.\n","*  **Cyclistic executive team**: The notoriously detail-oriented executive team will decide whether to approve the recommended marketing program."]},{"cell_type":"markdown","id":"4b93532a","metadata":{"papermill":{"duration":0.008469,"end_time":"2023-06-08T19:51:02.950813","exception":false,"start_time":"2023-06-08T19:51:02.942344","status":"completed"},"tags":[]},"source":["## Working approch \n","In this project, we will utilize the approach studied in the Google Data Analytics Certification program, which consists of six steps. These steps serve as a framework for conducting effective data analytics:\n","\n","* **Ask**: Identify the business task at hand and determine the key stakeholders involved in the project.\n","* **Prepare**: Collect the necessary data, understand its organization and structure, and evaluate its credibility and reliability.\n","* **Process**: Choose the appropriate tools for data cleaning, check for errors or inconsistencies, and document the cleaning process.\n","* **Analyze**: Organize and format the data, perform calculations, aggregate the data to reveal patterns and relationships, and identify relevant trends.\n","* **Share**: Utilize principles of design thinking and data-driven storytelling to effectively communicate the findings. Present the analysis with clear visualizations and ensure it addresses the initial business task.\n","* **Act**: Share the final conclusions derived from the analysis, along with actionable recommendations based on the insights gained.\n","By following this approach, we aim to conduct a comprehensive and structured data analysis in order to address the business objectives of this project.\n"]},{"cell_type":"markdown","id":"3a51f11f","metadata":{"papermill":{"duration":0.008722,"end_time":"2023-06-08T19:51:02.96802","exception":false,"start_time":"2023-06-08T19:51:02.959298","status":"completed"},"tags":[]},"source":["# Ask\n","\n","* **Identify the business question in relation to the needs of the stakeholders** :\n","\n","The primary objective is to analyze the usage patterns of Cyclistic riders in Chicago and identify key differences between casual riders and annual members. This analysis aims to support the marketing team's goal of converting casual riders into annual members.\n","\n","Cyclistic, a bike-sharing service, was launched in 2016 and has experienced significant growth, boasting a fleet of over 5,800 bikes located throughout the city of Chicago. The service offers three pricing plans: Single-Ride Pass, Full-Day Pass, and Annual Membership. These options cater to two distinct groups of riders: casual riders who prefer the flexibility of single-ride or full-day passes, and members who have subscribed to the annual membership.\n","\n","Lily Moreno, the Director of Marketing, has set a specific goal of converting casual riders into annual members. To support this objective, a comprehensive report has been created to provide insights into the ridership patterns of Cyclistic. As a member of the data analytics team, my assigned task is to analyze the data and identify notable differences in how casual riders and annual members utilize the Cyclistic service.\n","\n","* **Deliverables** :\n","\n","Clear articulation of the business task: Support the marketing team's efforts to convert casual riders into annual members by identifying and highlighting significant distinctions in how Cyclistic riders utilize the service in Chicago.\n","\n","**NB :** The objective of this analysis is to gain insights into current customer biking preferences and behaviors. To achieve this, it is essential to use sufficient and up-to-date data. In this case, a year of trip data is considered necessary to accurately capture the current biking trends. Therefore, the dataset selected for this analysis focuses on the most recent year, which is 2022. By using this recent and comprehensive dataset, the analysis aims to provide valuable insights into the present-day biking preferences and behaviors of customers.\n","\n"]},{"cell_type":"markdown","id":"2520b392","metadata":{"papermill":{"duration":0.008525,"end_time":"2023-06-08T19:51:02.985089","exception":false,"start_time":"2023-06-08T19:51:02.976564","status":"completed"},"tags":[]},"source":["# Prepare \n","\n","During this stage, our focus is to prepare the data for further processing. This involves defining metrics, collecting the necessary data, ensuring consistency and completeness, and verifying its credibility.\n","\n","* **Metrics** :\n","In this step, we aim to identify and measure the differences in bike usage patterns between casual users and annual members of Cyclistic. Due to privacy concerns and the nature of this capstone project, we will specifically concentrate on behavioral measurements. The following behavioral metrics will be analyzed to understand the disparities between the two groups:\n","\n","1. ***Biking usage***: This includes evaluating average frequency, average duration, and bike type preferences.\n","2.  ***Time-varying preferences***: We will examine patterns related to peak hours, day of the week, and month of bike usage.\n","3. ***Location-based preferences***: The analysis will focus on identifying the most and least frequent start and end locations.\n","By focusing on these behavioral measurements, we aim to gain insights into the distinctions in bike-sharing behaviors between casual users and annual members of Cyclistic.\n","\n","* **Dataset** \n","The dataset used for this analysis has been provided by Motivate International Inc. [under a specific licensing agreement](http://https://ride.divvybikes.com/data-license-agreement). The data can be accessed from the designated source, which is the \"Index of bucket\" divvy-tripdata\" website. The dataset is organized on a monthly basis and is available in compressed zip format. It covers a time range from April 2020 to April 2023.\n","\n","During the \"Ask\" stage, it was determined that the analysis would focus on the most recent year, which is 2022. Therefore, the dataset for the entire year of 2022 has been identified and is ready for download. You can access the relevant zip files for 2022 from the provided source.\n","\n","* **Uploading data to ou notebook**\n","\n","Considering that the analysis will be performed using R on Kaggle, the zip files containing the Cyclistic 2022 trip data will be uploaded to Kaggle. The designated path for uploading the files is \"/kaggle/input/cyclistic\". As a result, there are now 12 CSV files located under the path \"/kaggle/input/cyclistic\". These files will serve as the basis for the analysis conducted on Kaggle.\n"]},{"cell_type":"code","execution_count":1,"id":"88f9a442","metadata":{"execution":{"iopub.execute_input":"2023-06-08T19:51:03.006642Z","iopub.status.busy":"2023-06-08T19:51:03.004687Z","iopub.status.idle":"2023-06-08T19:51:04.104108Z","shell.execute_reply":"2023-06-08T19:51:04.102275Z"},"papermill":{"duration":1.112684,"end_time":"2023-06-08T19:51:04.106294","exception":false,"start_time":"2023-06-08T19:51:02.99361","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching core tidyverse packages\u001b[22m ──────────────────────── tidyverse 2.0.0 ──\n","\u001b[32m✔\u001b[39m \u001b[34mdplyr    \u001b[39m 1.1.2     \u001b[32m✔\u001b[39m \u001b[34mreadr    \u001b[39m 2.1.4\n","\u001b[32m✔\u001b[39m \u001b[34mforcats  \u001b[39m 1.0.0     \u001b[32m✔\u001b[39m \u001b[34mstringr  \u001b[39m 1.5.0\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2  \u001b[39m 3.4.2     \u001b[32m✔\u001b[39m \u001b[34mtibble   \u001b[39m 3.2.1\n","\u001b[32m✔\u001b[39m \u001b[34mlubridate\u001b[39m 1.9.2     \u001b[32m✔\u001b[39m \u001b[34mtidyr    \u001b[39m 1.3.0\n","\u001b[32m✔\u001b[39m \u001b[34mpurrr    \u001b[39m 1.0.1     \n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\u001b[36mℹ\u001b[39m Use the conflicted package (\u001b[3m\u001b[34m<http://conflicted.r-lib.org/>\u001b[39m\