display_data"}],"source":["# Create the bar of the count of rides by biketype   and  hour of day \n","ggplot( ride_counts_by_biketype_hour_of_day, aes(x =hour_of_day  , y = ride_counts_, fill = rideable_type)) +\n","  geom_bar(stat = \"identity\", position = \"dodge\") +\n","  labs(x = \"Hour of day \", y = \"Ride Counts\", fill = \" Bike type\") +\n","  ggtitle(\"Count of Rides by bike type  and  hour of day \")"]},{"cell_type":"markdown","id":"97e65fd4","metadata":{"papermill":{"duration":0.060943,"end_time":"2023-06-08T19:52:15.637542","exception":false,"start_time":"2023-06-08T19:52:15.576599","status":"completed"},"tags":[]},"source":["Here we can see that the annual members    use both types of bikes for their rides, but cusual users  show a clear preference for the electric   bikes,"]},{"cell_type":"markdown","id":"c54c47fd","metadata":{"papermill":{"duration":0.061685,"end_time":"2023-06-08T19:52:15.761227","exception":false,"start_time":"2023-06-08T19:52:15.699542","status":"completed"},"tags":[]},"source":["###  insights & conclusions\n","\n","* Members holds the biggest proportion of the total rides\n","* In all months we have more members than casual riders.\n","* For casual riders the biggest volume of data is on the the weekend.\n","* There is a bigger volume of bikers in the afternoon.\n","* This could be possible that member use bikes for work purpose, this information can be backed by their bike usage in colder months, where there is significant drop in casual members in those months.\n","\n","* Members have the bigger volume of data, except on saturday and sunday. On the weekend, casuals riders have the most data points.\n","* Casuals riders have more ride length (ride duration) than members. Average ride time of member are mostly same slight increase in end of week.\n","* We have more members during the morning, mainly from  7am . And more casuals between night ( after 22H) .\n"]},{"cell_type":"markdown","id":"5802b331","metadata":{"papermill":{"duration":0.062022,"end_time":"2023-06-08T19:52:15.884904","exception":false,"start_time":"2023-06-08T19:52:15.822882","status":"completed"},"tags":[]},"source":["# Act"]},{"cell_type":"markdown","id":"55b9b477","metadata":{"papermill":{"duration":0.061814,"end_time":"2023-06-08T19:52:16.008976","exception":false,"start_time":"2023-06-08T19:52:15.947162","status":"completed"},"tags":[]},"source":["Now that we  have finished creating our  visualizations, act on our  findings. and  Prepare the deliverables Morena asked us  to create, including the three top recommendations based on our  analysis. \n","* We suggest those recomandations *\n","\n","1.  Introduce a distinct pricing option for a weekend-only membership, separate from a  full annual membership.\n","2. Develop targeted marketing campaigns that effectively communicate the advantages of becoming an annual member. These campaigns can be delivered through email newsletters and advertisements strategically placed at docking stations. It is recommended to schedule these campaigns during the peak months of the year when the demand for memberships is at its highest. \n"," 3. To promote greater usage of bikes among casual riders and balance out demand throughout the day, consider implementing discounted pricing during off-peak hours. This approach incentivizes individuals to ride bikes during less busy times, thereby encouraging a more evenly distributed usage pattern."]},{"cell_type":"markdown","id":"55280408","metadata":{"papermill":{"duration":0.060981,"end_time":"2023-06-08T19:52:16.131081","exception":false,"start_time":"2023-06-08T19:52:16.0701","status":"completed"},"tags":[]},"source":["##  This is my inaugural notebook on Kaggle. I want to express my gratitude for your assistance in accomplishing this task. Additionally, please note that English is not my native language, so there may be some potential errors in translation.\n","## \n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"